import React, {useContext} from "react";
import {AuthContextTest} from "../../context/AuthContext--test";

function InlogTest(){
    const { login } = useContext(AuthContextTest);

    return(
        <>

            <input
                type="email"
                id= "email"/>

            <button type="button"
                    onClick={ login }
            title="inlog">Inloggen</button>
        </>
    )

}
export default InlogTest;
